import { FunctionComponent } from 'react';

const MaintenanceLayout: FunctionComponent<any> = () => (
  <main role="main">
    <img alt="Under construction" src="/under-construction.jpg" width="100%" />
    <img alt="Under construction" src="/under-construction.jpg" width="100%" />
    <img alt="Under construction" src="/under-construction.jpg" width="100%" />
  </main>
);

export default MaintenanceLayout;
